// client/src/pages/Login.js
import React, { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { loginUser } from '../features/authSlice';
import { useNavigate, Link } from 'react-router-dom';
import axios from 'axios';

export default function Login() {
  const [formData, setFormData] = useState({ username: '', password: '' });
  const [forgotEmail, setForgotEmail] = useState('');
  const [showForgot, setShowForgot] = useState(false);
  const [forgotMessage, setForgotMessage] = useState('');
  const dispatch = useDispatch();
  const auth = useSelector(state => state.auth);
  const navigate = useNavigate();

  useEffect(() => {
    if (auth.token) navigate('/');
  }, [auth.token, navigate]);

  const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = e => {
    e.preventDefault();
    dispatch(loginUser(formData));
  };

  const handleForgotSubmit = async e => {
    e.preventDefault();
    setForgotMessage('');
    try {
      // Replace with your actual backend endpoint for forgot password
      await axios.post('/api/auth/forgot-password', { email: forgotEmail });
      setForgotMessage('If this email exists, a reset link has been sent.');
    } catch {
      setForgotMessage('Failed to send reset email. Please try again.');
    }
  };

  return (
    <div className="max-w-md mx-auto mt-20 p-8 bg-white rounded shadow">
      {!showForgot ? (
        <>
          <h2 className="text-2xl font-semibold mb-6 text-center">Login</h2>
          {auth.error && <p className="mb-4 text-red-600 text-center">{auth.error}</p>}
          <form onSubmit={onSubmit} className="space-y-4">
            <input
              name="username"
              value={formData.username}
              onChange={onChange}
              placeholder="Username"
              required
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={onChange}
              placeholder="Password"
              required
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
            <button
              type="submit"
              disabled={auth.loading}
              className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700 transition disabled:opacity-50"
            >
              {auth.loading ? 'Logging in...' : 'Login'}
            </button>
          </form>
          <div className="mt-4 text-center">
            <button
              onClick={() => setShowForgot(true)}
              className="text-sm text-blue-600 hover:underline"
            >
              Forgot password?
            </button>
          </div>
          <p className="mt-6 text-center text-gray-600">
            New here?{' '}
            <Link to="/register" className="text-blue-600 hover:underline">
              Register now
            </Link>
          </p>
        </>
      ) : (
        <>
          <h2 className="text-2xl font-semibold mb-6 text-center">Reset Password</h2>
          {forgotMessage && (
            <p className="mb-4 text-center text-green-600">{forgotMessage}</p>
          )}
          <form onSubmit={handleForgotSubmit} className="space-y-4">
            <input
              type="email"
              name="email"
              value={forgotEmail}
              onChange={e => setForgotEmail(e.target.value)}
              placeholder="Enter your email"
              required
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
            <div className="flex justify-between items-center">
              <button
                type="submit"
                className="bg-blue-600 text-white py-2 px-6 rounded hover:bg-blue-700 transition"
              >
                Send Reset Link
              </button>
              <button
                type="button"
                onClick={() => {
                  setShowForgot(false);
                  setForgotMessage('');
                  setForgotEmail('');
                }}
                className="text-gray-600 underline hover:text-gray-800"
              >
                Cancel
              </button>
            </div>
          </form>
        </>
      )}
    </div>
  );
}
